.cv-item {
  padding: 10px 0;
  /* border-top: 1px solid #9399b2; */
  border-bottom: 1px solid #9399b2;
}

.cv-item-header {
  font-size: 1.1em;
  display: flex;
  flex-direction: column;
}
p.description {
  margin: 0;
}

div.cv-item-name {
  text-align: center;
  font-weight: bold;
}

div.cv-item-date {
  text-align: center;
}
div.cv-item-place {
  font-style: italic;
}

@media (min-width: 480px) {
  .cv-item-header {
    font-size: 1.1em;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
  }

  div.cv-item-name {
    text-align: left;
  }

  div.cv-item-date {
    text-align: right;
  }

  p.description {
    text-align: left;
  }
  div.cv-item-place {
    text-align: left;
  }
}

